import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./pages/frontend/Home";


function App() {
  return (
    <BrowserRouter>
        <Routes>
            <Route index element={<Home/>}/>
            <Route path element={<Home/>}/>
            <Route index element={<Home/>}/>

        </Routes>

    </BrowserRouter>
  );
}

export default App;
